import React, { useContext } from "react";
import TransactionContext from "../Context/TransactionContext";

function AllData() {
    const { data } = useContext(TransactionContext);
    return(
        <>
        <h1>AllData</h1>
        <p>{JSON.stringify(data)}</p>
        </>
    );
}

export { AllData };
